import React from 'react';
import {Firstname,Lasttname} from '../../jsx/App';
const CompC=()=>{
    return(
        <>
     <Firstname.Consumer>{(fname)=>{
        return(
            <Lasttname.Consumer>{(lname)=>{
                return <h1>My Name is {fname} {lname}</h1>;
            }}</Lasttname.Consumer>
        )
    }}</Firstname.Consumer>
    </>
    )
};
export default CompC;
